    public static long getDelayTime(long interval, long nextExecuteTime, long currentTime) {
        if (nextExecuteTime >= currentTime) {
            return nextExecuteTime - currentTime;
        }
        if (interval == 0) {
            return 0;
        }
        long passTime = currentTime - nextExecuteTime;
        if (passTime % interval == 0) {
            return 0;
        }
        return ((passTime / interval) + 1) * interval - passTime;
    }


