    public <T> T showClazz(Class<T> type) {
        X1 x1 = new X1(1, 2);
        Class<? extends X1> aClass = x1.getClass();
        System.out.println(X.class.isAssignableFrom(aClass));
        return null;
    }



    static class Bool {
        boolean flag;
        int x;

        public Bool(boolean flag, int x) {
            this.flag = flag;
            this.x = x;
        }

        public boolean isFlag() {
            return flag;
        }

        public void setFlag(boolean flag) {
            this.flag = flag;
        }

        public int getX() {
            return x;
        }

        public void setX(int x) {
            this.x = x;
        }

        @Override
        public String toString() {
            return "Bool{" +
                    "flag=" + flag +
                    ", x=" + x +
                    '}';
        }
    }

    class X1 extends X {

        public X1(int a, int b) {
            super(a, b);
        }
    }


    class X {
        private int a;
        private int b;

        public X(int a, int b) {
            this.a = a;
            this.b = b;
        }

        public int getA() {
            return a;
        }

        public void setA(int a) {
            this.a = a;
        }

        public int getB() {
            return b;
        }

        public void setB(int b) {
            this.b = b;
        }

    }
